column8:
スイーツをテーマにした、かわいい色合いの単色カラーセットです。<br>
単色カラー36カセ<br><br>

◆太さ：5番糸タイプ<br>
◆長さ：9.14m/カセ<br>
◆素材：コットン100％<br><br>

※写真と実際の商品の色とは多少異なる場合があります。<br>

<p>※メーカー希望小売価格はメーカーカタログに基づいて掲載しています。<br>


<img src="http://image.rakuten.co.jp/yuzawaya-2/cabinet/evidence361-01-866_evidence.jpg" border="0"
 width="300" alt="evicence"></p><style type="text/css">
